 complexed with a hydroxamic acid inhibitor (

 ) was published by Feng et al . Using the Hanessian group published binding affinity data and the structure published by Feng as a basis , we have built a binding affinity model by targeting the S ( 2 ) ' pocket of the enzyme with a set of nine alpha-N-sulfonylamino hydroxamic acid derivatives . Two binding geometries of each ligand have been generated corresponding to two binding modes denoted A and B , respectively , of which the first one is targeting the S ( 2 ) ' pocket and the second one the S ( 1 ) pocket . For the binding affinity model developed for mode A the computed activities show a rmsd of 0.583 kcal / mol as compared with the experimental data , and a correlation coefficient r ( 2 ) of 0.779 , while in the case of the binding mode B a rmsd of 0.834 kcal / mol and correlation coefficient r ( 2 ) of 0.500 , respectively , were obtained . In conclusion , our data suggest a higher probability for the DB00120 ( 76 ) gated S ( 2 ) ' open form pocket to accommodate the substituent alpha versus the wide solvent exposed S ( 1 ) subsite , probability which some research groups could have overlooked due to extensive use in their calculations of non revealing S ( 2 ) ' pocket open state crystallographic structures instead of NMR ones .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Eupolyphaga sinensis walker displays inhibition on hepatocellular carcinoma through regulating cell growth and metastasis signaling . Tumor growth and metastasis are responsible for most cancer patients ' deaths . Here , we report that eupolyphaga sinensis walker has an essential role in resisting hepatocellular carcinoma growth and metastasis . Compared with proliferation , colony formation , transwell assay and transplantable tumor in nude mouse in vitro and vivo , eupolyphaga sinensis walker extract ( ESWE ) showed good inhibition on the SMMC - 7721 cell growth and metastasis . Using genome-wide microarray analysis , we found the down-regulated growth and metastasis factors , and selected down-regulated genes were confirmed by real-time PCR . Knockdown of a checkpoint PKC by siRNA significantly attenuated tumor inhibition and metastasis effects of ESWE . Moreover , our results indicate ESWE inhibits HCC growth by not only downregulating the signaling of PKC , Akt , m-TOR , Erk 1/2 , MEK - 2 , Raf and JNK - 1 , but also increasing cyclin D1 protein levels and decreasing amount of cyclin E , cyclin B1 and cdc 2 of the cycle proteins . At the same time , ESWE reduced

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Genetic demonstration of intestinal Q9UHC9 as a major determinant of hepatic cholesterol and blood atherogenic lipoprotein levels . OBJECTIVE : The correlation between intestinal cholesterol absorption values and plasma low-density lipoprotein-cholesterol ( LDL-C ) levels remains controversial . Niemann-Pick-C 1 - Like 1 ( Q9UHC9 ) is essential for intestinal cholesterol absorption , and is the target of ezetimibe , a cholesterol absorption inhibitor . However , studies with Q9UHC9 knockout mice or ezetimibe can not definitively clarify this correlation because Q9UHC9 expression is not restricted to intestine in humans and mice . In this study we sought to genetically address this issue . METHODS AND RESULTS : We developed a mouse model that lacks endogenous ( Q9UHC9 ) and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01130
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01130
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) ( DKO ) , but transgenically expresses human Q9UHC9 in gastrointestinal tract only ( DKO / Q9NUQ9 ( IntOnly ) mice ) . Our novel model eliminated potential effects of non-intestinal Q9UHC9 on cholesterol homeostasis . We found that human Q9UHC9 was localized at the intestinal brush border membrane of DKO / Q9NUQ9 ( IntOnly ) mice . DB04540 feeding induced formation of Q9UHC9 - positive vesicles beneath this membrane in an ezetimibe-sensitive manner . Compared to DKO mice , DKO / Q9NUQ9 ( IntOnly ) mice showed significant increases in cholesterol absorption and blood / hepatic / biliary cholesterol . Increased blood cholesterol was restricted to very low-density lipoprotein ( VLDL ) and LDL fractions , which was associated with increased secretion and plasma levels of apolipoproteins B100 and B48 . Additionally , DKO / Q9NUQ9 ( IntOnly ) mice displayed decreased fecal cholesterol excretion and hepatic / intestinal expression of cholesterologenic genes . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00973
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 treatment virtually reversed all of the transgene-related phenotypes in DKO / Q9NUQ9 ( IntOnly ) mice . CONCLUSION : Our findings from DKO / Q9NUQ9 ( IntOnly ) mice clearly demonstrate that Q9UHC9 - mediated cholesterol absorption is a major determinant of blood levels of apolipoprotein B-containing atherogenic lipoproteins , at least in mice .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Recommendations for the treatment of Crohn ' s disease with tumor necrosis factor antagonists : an expert consensus report . BACKGROUND : Symptom relief is the traditional treatment goal in Crohn ' s disease ( CD ) . New goals including mucosal healing and bowel preservation are now achievable with tumor necrosis factor (

</mark>
 ) antagonists . DB00065 and adalimumab are approved as second-line treatments for severe , active CD . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08904
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is approved only in the U . S . and Switzerland as second-line treatment for moderate-to-severe , active CD . Data from trials of infliximab suggest that high-risk patients and patients with active inflammation ( CRP elevation and / or ileocolonic ulcers ) may benefit from earlier use of this drug . METHODS : A Delphi survey was used to obtain consensus on issues surrounding bowel preservation and use of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 antagonists . At the time of this survey , infliximab was the only 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 antagonist approved for the treatment of CD in Europe , Canada , and Australia . An expert panel of 12 gastroenterologists with substantial clinical experience using infliximab in clinical practice and trials in these areas participated . RESULTS : The experts agreed that bowel preservation and mucosal healing are relevant and achievable goals , and form a rationale for using 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
